script: |
  super -f text -I q209.spq | sort > q209.out

inputs:
  - name: q209.spq
    data: |
      SELECT ALL col0 * col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 * + ( - col0 ) NOT BETWEEN NULL AND ( - col0 * col0 );
  - name: tab1

outputs:
  - name: q209.out
    data: |
      2601
      7225
      8281
